// For generating new recipe combinations

// close the database connection

app.post("/writeGeneratedRecipe/:id", async (req, res) => {
  const carbs = ["Rice", "Boiled potato", "Pasta", "Bread", "oats"];
  const protein = ["Chicken", "Eggs", "Beef", "Pork", "Beans", "Linsel"];
  const id = req.params.id;
  const imagePath =
    "data:image/webp;base64,";
  generatedContent = {
    title: "Generated Meals",
    subTitle: "Lets make a nice combination",
    imagePath: imagePath,
    carbs: _.sample(carbs),
    protein: _.sample(protein),
  };

  if (!generatedContent) {
    return res.sendStatus(400);
  }
  await fs.mkdir("data/recipe", { recursive: true });
  await fs.writeFile(`data/recipe/${id}.txt`, JSON.stringify(generatedContent));

  return res.status(201).json({
    id: id,
    generatedContent,
  });
});
// For writing recipes giving an ID with the URL
// The body passed should include title, sub title, image path ( which is in base64) and content
app.post("/writeRecipe/:id", async (req, res) => {
  const content = req.body.content;
  const title = req.body.title;
  const subTitle = req.body.subTitle;
  const imagePath = req.body.imagePath;
  const id = req.params.id;
  if (!content | !title | !subTitle | !imagePath) {
    return res.sendStatus(400);
  }
  recipe = {
    title: title,
    subTitle: subTitle,
    imagePath: imagePath,
    content: content,
  };

  if (!recipe) {
    return res.sendStatus(400);
  }
  await fs.mkdir("data/recipe", { recursive: true });
  await fs.writeFile(`data/recipe/${id}.txt`, JSON.stringify(recipe));

  return res.status(201).json({
    id: id,
    recipe,
  });
});
// To get a single recipe if the ID is known

app.post("/writeMeals/:id", (req, res) => {
  // extract the recipe data from the request body
  const content = req.body.content;
  const title = req.body.title;
  const subTitle = req.body.subTitle;
  const image = req.body.image;
  const id = req.params.id;

  // validate the input data
  if (!content || !title || !subTitle || !image || !id) {
    return res.status(400).send("Invalid input data");
  }

  // create a connection to the database
  const db = new sqlite3.Database("./sqlite DB/mealsDB.db", (err) => {
    if (err) {
      console.error(err.message);
      return res.status(500).send("Error connecting to database");
    }
    console.log("Connected to the mealsDB database.");

    // insert the recipe data into the database
    db.run(
      `UPDATE mealsDB SET title = ?, subtitle = ?, content = ?, image = ? WHERE id = ?`,
      [title, subTitle, content, image, id],
      function (err) {
        if (err) {
          console.error(err.message);
          return res.status(500).send("Error inserting data into database");
        }
        console.log(`A new row has been inserted with rowid ${this.id}`);
        return res.status(201).json({
          id: id,
          title: title,
          subTitle: subTitle,
          content: content,
          image: image,
        });
      }
    );

    // close the database connection
    db.close((err) => {
      if (err) {
        console.error(err.message);
      }
      console.log("Closed the mealsDB database connection.");
    });
  });
});
